import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

import Navigation from '../Navigation';
import SignUp from '../SignUp';

const App = () => (
  <Router>
    <Navigation />
    <SignUp />
  </Router>
);

export default App;
